import React from "react";

function Main() {
	return (
		<div className='main'>
			<select name="animals" id="animals">
            <option value="lion">Lion</option>
            <option value="tiger">Tiger</option>
            <option value="jaguar">Jaguar</option>
         </select>
		</div>
	);
}

export default Main;
